import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';

const App: React.FC = () => {
  const [farms, setFarms] = useState<any[]>([]);
  const [otherData, setOtherData] = useState<any[]>([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8080/api/farms')
      .then(response => {
        setFarms(response.data.farms); // Extract farms data from response
        setOtherData(response.data.other_data); // Extract other_data from response
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div className="App">
      <h1>Animal Movement Tracker</h1>
      <div>
        <h2>Farms</h2>
        <ul>
          {farms.map((farm: any, index: number) => (
            <li key={index}>
              <p>Premise ID: {farm.premiseid}</p>
              <p>Total Animals: {farm.total_animal}</p>
            </li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Other Data</h2>
        <ul>
          {otherData.map((data: any, index: number) => (
            <li key={index}>
              <p>{/* Render other data here */}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
